import './App.css';
import Header from "./Components/Header"
import Home from "./Components/Home"
import TechSidebar from './Components/TechSidebar';
import Posts from "./Components/"

function App() {
  return (
    <div className="App">
      <Header />
      <Home />
      <TechSidebar />
      <Posts />
    </div>
  );
}

export default App;
